Memphis Raines must return to the world of auto theft after his brother breaches a contract with a Russian crime lord to deliver high end cars. Memphis must get a gang together for a one night &amp;#039;boost&amp;#039; to grab all the cars while avoiding apprehension by the auto theft cop who trailed him years before. Written by FMJ_Joker

Kip Raines, a young car thief, was contracted to steal 50 specific cars but something went wrong. Now the man who hired him, Raymond Calitri, wants his head. When his brother, Memphis, once a great car thief, who retired a few years ago, learns of this, he comes back to town to see if he can help his brother. The only thing that will appease Calitri is if the order is fulfilled. So Memphis has to assemble his old crew, and he has to do the job in a few days. And a cop who hounded him, upon learning of his return, is keeping an eye on him. And another car thief, whom he competed with before wants to get the Calitri job, and is telling Memphis to back off, but he won&amp;#039;t. Written by &lt;a class=&quot;__cf_email__&quot; href=&quot;/cdn-cgi/l/email-protection&quot; data-cfemail=&quot;ea988999dadedbdbaa938b828585c4898587&quot;&gt;[email&amp;#160;protected]&lt;/a&gt;&lt;script cf-hash='f9e31' type=&quot;text/javascript&quot;&gt;
